export default function ShowWeather() {
    const weatherDatas = {
    content :    {
            temp: 1,
            feels: -2,
            humidity: 90,
            location: 'Dortmund',
            locationC: 'DE',
            wind: 3,
            icon: 'https://openweathermap.org/img/wn/13n@2x.png',
            desc: 'light snow'
          }
    }
return(

<div className="bg-gradient-to-r from-blue-300 to-blue-500 opacity-90 w-80 h-auto grid justify-center rounded-xl transform transition-transform duration-500 hover:scale-105 hover:shadow-2xl">
  <div className="font-bold text-orange-600 text-2xl">
    <h3>{weatherDatas.content.location}</h3>
  </div>
  <div>
    <h1 className="font-extrabold text-orange-800 text-9xl">
      {weatherDatas.content.temp}°
    </h1>
    <span className="font-semibold text-orange-500 text-lg">
      {weatherDatas.content.desc}
    </span>
  </div>
  <div className="text-2xl font-semibold text-orange-700 text-opacity-85 flex justify-around mt-4">
    <span className="flex flex-col items-center">
      {weatherDatas.content.feels}
      <p className="text-orange-600 font-medium text-sm">Feels</p>
    </span>
    <span className="flex flex-col items-center">
      {weatherDatas.content.humidity}
      <p className="text-orange-600 font-medium text-sm">Humidity</p>
    </span>
    <span className="flex flex-col items-center">
      {weatherDatas.content.wind}
      <p className="text-orange-600 font-medium text-sm">Wind</p>
    </span>
  </div>
</div>


